import logo from './logo.svg';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import { AppBar, Toolbar } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';


function App() {
  return (
    <div className="App">
      <div>
      <Box>
        <AppBar>
          <Toolbar>
            <MenuIcon/>
          </Toolbar>
        </AppBar>
      </Box>
    </div>
    </div>
  );
}




export default App;
